DecisionTree Regressor: 
 
  ccp_alpha: 0.0
 
  criterion: squared_error

  min_impurity_decrease: 0.0
  min_samples_leaf: 1
  min_samples_split: 2
  min_weight_fraction_leaf: 0.0

  splitter: best
ElasticNet Regression: 
 
  alpha: 1.0
  copy_X: true
  fit_intercept: true
  l1_ratio: 0.5
  max_iter: 1000
  positive: false
  precompute: false

  selection: cyclic
  tol: 0.0001
  warm_start: false
Lasso Regression: 
 
  alpha: 1.0
  copy_X: true
  fit_intercept: true
 
  max_iter: 1000
  positive: false
  precompute: false

  selection: cyclic
  tol: 0.0001
  warm_start: false
